import React from 'react';

function Portfolio() {
    return(
        <div class="border p-5">
        <h1 id="portfolio">Projects</h1>
        <div class="projects">
            <div class="single-project">
                <a href="https://code-prep-project.herokuapp.com/" target="_blank">
                    <img class= "w-60 h-55" src="../../assets/imgaes/code-prep.png" alt="Website example of Code Prep."></img>
                Code Prep</a>
            </div>
        </div>
        </div>
        

    )
}

export default Portfolio;
